ÖZELLİKLER
&nbsp;
Türkiye’de üretilmiştir.
Ürün Stok Kodu: T_JC_28055

&nbsp;
CONNECT³ Bebek Arabası
&nbsp;
Dünya bebek arabaları şampiyonası altın madalyası olarak bilinen prestijli ‘’Kind &amp; Jugend Yenilik Ödülü’’* sahibi, benzersiz manyetik sistemli BUMPRIDER CONNECT³ ile tanışın! 

Ünlü İsveç’li tasarımcılar tarafından yaratılan olağanüstü yenilikçi Bumprider Connect³, bir bebek arabasında ihtiyaç duyabileceğiniz tüm işlevleri sunarken, birçok çeşitlilikte kullanılabilen devrim niteliğinde patentli bir manyetik bağlantı sistemi ile donatılmıştır. Bu benzersiz kompakt bebek arabasının manyetik sistemi gerektiğinde başka bir Bumprider Connect³ bebek arabası ile birleştirerek anında ikiz bebek arabasına dönüştürmenizi ve yüksek taşıma kapasiteli malzeme çantalarını takabilmenizi sağlar.

Bebek oto koltukları ve portbebe de takılabilen Bumprider Connect³ bebek arabaları, tamamen yatabilen sırt desteği sayesinde doğumdan itibaren 4 yaşına kadar kullanılabilir.&nbsp;
&nbsp;&nbsp; 
Bumprider Connect³ Bebek Arabalarını Özel Kılan Nedir?
Bumprider Connect³, gerçek bir hibrit modeldir.&nbsp;Manyetik sistemi sayesinde anında bir başka Connect³ bebek arabası ile birleşir ve ikiz bebek arabasına dönüşebilir! 
Bumprider Connect³, rakip ürünlere göre daha yüksek taşıma kapasitesi ve %35'e kadar daha iyi denge sağlayan İsveç'in en zorlu koşullarında test edilmiş güncellenmiş versiyondur.&nbsp;&nbsp; 
Ürün Özellikleri:

Başka bir bebek arabası ve her iki yanına malzeme çantaları takılabilen benzersiz bir manyetik sistem ile donatılmış ilk ve tek bebek arabasıdır.
Dünyanın uçuş sırasında kapatılabilen Uçuş Modu olan ilk ve tek bebek arabasıdır.
5 nokta emniyet kemer sistemi ile çocuğunuz her zaman güvendedir.&nbsp; 
Ağırlığı azaltmak, portbebe veya bebek oto koltuğu takmak için çıkarılabilir kılıfı ve sırt desteği bulunur. 
Tamamen düz yatırılabilir sırt desteği istenilen pozisyonda kullanılabilir.
Ayarlanabilir ön güvenlik barı vardır. 
Ayarlanabilir ayak desteği bulunur.
Dahili süspansiyon, sürüşü konforlu hale getirir.
Dayanıklı birinci sınıf PU tekerlekleri güvenli sürüş olanağı sağlar.
Kilitlenebilir 360° döner ön tekerlekleri bulunur.
Son derece pratik dokunmatik pedallı fren sistemi bulunur.
Gelişmiş sürdürülebilirlik için çift katmanlı kumaşlar kullanılmıştır.
Bebek oto güvenlik koltukları takılarak pratik bir travel sisteme dönüşebilir. (Universal adaptörler ayrı olarak satılmaktadır)
Ultra hafif portbebe kolaylıkla takılır. (Ayrıca satılan aksesuardır)
Kolay kaldırma ve taşıma için taşıma kolu + taşıma askısı bulunur.
Taşıma sırasında bebek arabanızı korumak için taşıma çantası bulunur. 
&nbsp;
&nbsp; 
Markanın Ait Olduğu Ülke: İsveç 
&nbsp;

Üretim Yeri: Çin 
&nbsp;

Uygun Olduğu Avrupa Standardı: EN 1888-1:2018 / EN 1888-2:2018
&nbsp;

Kullanım Yaşı: 0 – 4 yaş (&nbsp;Doğumdan itibaren 25 kg’a kadar) 
&nbsp;
Şase Ağırlığı: 7,22 kg
&nbsp;
Boyutlar: Katlanmış: 23 x 49 x 62 cm / Açık: 90 x 50 x 107 cm
&nbsp;
Oturma Ünitesi: 34 cm 
&nbsp;
Sırt Desteği: 44 cm
&nbsp;
Paket Koli İçeriği: Connect³ Bebek Arabası Şasesi, Oturma Ünitesi, Tente, Ön Güvenlik Barı,&nbsp;Alt Malzeme Sepeti, Taşıma Çantası
&nbsp;
Temizlik ve Bakım: 
Bebek arabanızı düzenli aralıklarla kontrol ediniz ve bakım öncesi kum, çamur ve gıda kalıntıları gibi maddeleri temizleyiniz.&nbsp;Bebek arabasının tüm parçaları ılık sabunlu su ile silinebilir. Oturma ünitesi kılıfı ve sırt desteği 30° C’de elde yıkanabilir. Ağartıcı temizlik malzemeleri kullanmayınız. Temizleme işleminden sonra iyice kuruduğundan emin olunuz.
Bebek arabanızın&nbsp; işlevlerinden herhangi birinin çalışmaması durumunda, Bumprider yetkili servisi ile iletişime geçiniz. Daha fazla bilgi için kullanım kılavuzunu inceleyiniz.
&nbsp;
Garanti Süresi: Satın alma tarihinden itibaren 24 aydır. Ürün faturasını saklayınız.
&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;
&nbsp;
&nbsp;




Maxi-Cosi Cabriofix Oto Koltuğu Ana Kucağı
&nbsp;

Doğumdan itibaren 12 aya kadar kullanım
3 noktalı emniyet kemeri
Yan Darbe Koruma Sistemi
IsoFix baza ile ekstra güvenlik
Daha fazla rahatlık için ek baş desteği&nbsp;
&nbsp;
Grup 0+ / Doğumdan itibaren 12 aya kadar (0-13 kg)&nbsp;
&nbsp;
Bebeğinizin Maxi-Cosi CabrioFix oto güvenlik koltuğunda rüyalara dalmasına izin verin! Bebeğinizi uyandırmadan, hafif CabrioFix oto güvenlik koltuğunu aracınızdan herhangi bir Maxi- Cosi veya Quinny bebek arabasına kolayca transfer edin.&nbsp;
CabrioFix oto güvenlik koltuğunu ister FamilyFix (Isofix) baza, 2wayFix baza yada Easybase 2 emniyet kemeri bazası ile kullanın. Her durumda CabrioFix oto güvenlik koltuğu güvenlik ve üst düzey kullanım kolaylığı açısından en mükemmel tercihtir.&nbsp;
&nbsp;
Özellikler:
Kanıtlanmış güvenlik
&nbsp;
FamilyFix ve EasyFix baza üniteleriyle birlikte mükemmel test sonuçları
Araç emniyet kemeri ya da 2wayFix, FamilyFix veya EasyBase 2 baza üniteleri ile kolay bağlantı
Mümkün olan en iyi IsoFix güvenliği ve FamilyFix baza ünitesi ile kolay kullanım. Baza aynı zamanda Pearl oto güvenlik koltuğu ile de uyumludur.
Yan Darbe Koruma Sistemi olası yan darbelere karşı optimum koruma sağlar.
FamilyFix üzerinde kullanılan CabrioFix ekstra dik pozisyonuyla, bebeğinizin bacakları için ilave alan yaratarak, daha güvenli ve uzun süreli sürüş yönünün tersine bağlantıya imkan verir.
Güncel Avrupa Birliği güvenlik standardı ECE R44/04'e uyumludur.
&nbsp;
Bebeğinizin konforu
&nbsp;
Bebeğiniz için konforlu bir uyum sağlar
Daha küçük bebekler için kafa çevreleyicisi için ekstra yastık, kemer dolguları ve entegre tente içerir
Tek hareketle ayarlanabilen kemer
Bebeğinizi yerleştirebilmeniz için kemeri toplayan kemer tokaları&nbsp;
&nbsp;
Kullanım kolaylığı
&nbsp;
Tüm Maxi-Cosi ve Quinny bebek arabaları ile pusetlere uyumlu olup, size pratik ve şık bir seyahat sistemi sunar.
Maxi-Cosi baza ünitesiyle kullanıldığı zaman araç emniyet kemeriyle bağlantıya gerek yoktur, sadece takın ve yola çıkın.
